    // </header>
    <header className="flex justify-between items-center bg-[#C1E8FF]">
      <nav className="flex h-16 justify-between items-center space-x-4 text-black">
        <div className="flex items-center space-x-4">
          <Link to="/" className="text-3xl font-bold text-[#060606]">
            MrBri<span className="text-[#1057E0]">Cool</span>
          </Link>
          <Link to="/" className="text-blue-900 font-bold hover:underline">
            Devenir MrBriCool
          </Link>
        </div>
        <div className="flex items-center space-x-10">
          <Link
            to="/"
            className="text-white font-bold text-center bg-[#1057E0] hover:bg-blue-800 outline-none rounded-3xl text-sm px-5 py-2.5 focus:outline-none"
          >
            Trouver un Bricoleur
          </Link>
          <div className="flex items-center">
            <Link
              to="/"
              className="text-black font-bold text-center bg-white hover:bg-gray-100 outine-none rounded-3xl text-sm px-5 py-2.5 mr-3 focus:outline-none"
            >
              S'inscrire
            </Link>
            <Link
              to="home"
              className="text-black font-bold text-center bg-white hover:bg-gray-100 outine-none rounded-3xl text-sm px-5 py-2.5 focus:outline-none"
            >
              Se Connecter
            </Link>
          </div>
        </div>
      </nav>

      <div onClick={handleNav} className="block md:hidden">
        {!nav ? <AiOutlineClose size={25} /> : <AiOutlineMenu size={25} />}
      </div>
      <div
        className={
          !nav
            ? "fixed left-0 top-0 w-[60%] h-full border-r border-r-gray-900 bg-[#338cf3] ease-in-out duration-500"
            : "fixed left-[-100%]"
        }
      >
        <Link to="/" className="text-3xl font-bold text-black m-4">
          MrBri<span className="text-[#1057E0]">Cool</span>
        </Link>
        <ul className="uppercase p-4">
          <li className="p-4 border-b border-gray-600">
            <Link to="/">Trouver un Bricoleur</Link>
          </li>
          <li className="p-4 border-b border-gray-600">
            <Link to="/">S'inscrire</Link>
          </li>
          <li className="p-4">
            <Link to="home">Se Connecter</Link>
          </li>
        </ul>
      </div>
    </header>
  );
};

export default NavbarTop;
